import React from "react";
import "./Header.css";

export default function Header({ title }) {
  return (
    <>
      <h1 className="header" data-testid="header-1">
        {title}
      </h1>
      //{" "}
      <h3 Title="Header" className="header">
        Cats
      </h3>
    </>
  );
}
